sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "subscriptionname"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "subscriptionname"]);
    var payload = {
        "pushConfig": {}
    };
    var pushConfig = inputs.pushConfig;
    if (pushConfig.pushEndpoint.trim()) {
        payload["pushConfig"]["pushEndpoint"] = pushConfig.pushEndpoint.trim();
        if (pushConfig.oidcToken.serviceAccountEmail.trim()) {
            payload["pushConfig"]["oidcToken"] = {
                "serviceAccountEmail": pushConfig.oidcToken.serviceAccountEmail.trim(),
                "audience": pushConfig.oidcToken.audience.trim()
            }
        }
    }
    var pushAttributes = pubSub.arrayObjecttoObject(pushConfig["attributes"]);
    if (pushAttributes)
        payload["pushConfig"]["attributes"] = pushAttributes;
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

